Você não precisa ser forte o tempo todo. Pode chorar. Porque chorar é coisa de gente grande, é coisa de quem não tem vergonha de dizer o que sente, é coisa de quem sabe que quando o os problemas se acumulam, se torna uma bobagem fazer força desnecessária para carregá-los. Os dias ruins estarão sempre por aí, então, ao invés de insistir em medir forças com o destino, chore, aceite que você não conseguirá ganhar todas, aprenda a parar para descansar quando a vida estiver corrida demais, aprenda a olhar para si mesmo e dizer que não há nada de errado em se perder, às vezes. O mundo é cruel com todos. Você não precisa provar a ninguém que não sente o peso dos problemas sobre os seus ombros. Chore. Porque chorar é coisa de gente corajosa. E isso eu sei que você é.

