Uno dei più classici piatti autunnali, intramontabile e sempre buonissimo, pensato da una nostra follower sul gruppo Facebook Chef in Privato. Se state pensando: "Beh semplice, questo lo avrei potuto fare anch'io!", passate all'azione e fatelo anche voi, iscrivetevi al nostro gruppo privato su Facebook, partecipate ai contest e il vostro piatto potrebbe essere riprodotto dagli Chef in Camicia!
-
Ingredienti per 2 persone
Tempo di preparazione: 15 minuti
Difficoltà: Facile

Fettuccine, 200g;
Panna, 200ml;
Funghi porcini, 150g;
Prezzemolo, q.b.;
Aglio, 1;
Olio evo, q.b.
